import styled from 'styled-components'

export const StyledContainer = styled.div`
  margin-top: 20px;
  display: flex;
  justify-content: center;
  align-items: center;
`

export const CardContainer = styled.div`
  width: 70%;
  display: flex;
  justify-content: space-around;
`

export const CardDiv = styled.div`
  width: 200px;
  height: 200px;
  background: red;
  border-radius: 4px;
`
